import React from 'react'
import { View, Text } from 'react-native'

export default function DM({route,navigation}) {
    const {item} = route.params;
    const {name,image,username} =item
    return (
        <View>
            <Text>{name}</Text>
            <Text>{username}</Text>
            <Text>{image}</Text>
        </View>
    )
}
